import React, { Component } from 'react';
import Navbar from '../Homepage/Navbar';
import Aux from '../../../hoc/Aux';

class Homepage extends Component {
    render(){
        return(
            <Aux>
                <Navbar/>
                <section className="home bg-img-1" id="home">
                    <div className="bg-overlay"></div>
                    <div className="container">
                        <div className="row">
                            <div className="col-sm-12 text-center">
                                <div className="home-fullscreen">
                                    <div className="full-screen">
                                        <div className="home-wrapper home-wrapper-alt">
                                            <h2 className="font-light text-white">Ubold is a fully featured premium
                                                admin template</h2>
                                            <h4 className="text-white">Ubold is a fully featured premium admin template
                                                built on top of awesome Bootstrap 3.3.7, modern web technology HTML5,
                                                CSS3 and jQuery. It has many ready to use hand crafted components. </h4>
                                            <a href="http://themeforest.net/item/ubold-responsive-web-app-kit/13489470?ref=coderthemes"
                                               target="_blank" className="btn btn-custom">Buy Template</a>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </Aux>
        );
    }
}

export default Homepage;
